import React, { useEffect } from 'react';
import { connect } from 'react-redux';
import { fetchData } from './actions/projectActions';

const ProjectContainer = ({ data, loading, error, fetchData }) => {
  useEffect(() => {
    // Dispatch the fetchData action when the component mounts
    fetchData();
  }, [fetchData]);

  if (loading) {
    return <div>Loading...</div>;
  }

  if (error) {
    return <div>Error: {error}</div>;
  }

  return (
    <div>
      {fetchData}
    </div>
  );
};

const mapStateToProps = (state) => ({
  data: state.data.data,
  loading: state.data.loading,
  error: state.data.error,
});

const mapDispatchToProps = {
  fetchData,
};

export default ProjectContainer(mapStateToProps, mapDispatchToProps)(MyComponent);
